      onFinish={onFinish}
      onFinishFailed={onFinishFailed}
      autoComplete="off"
    >
      <Form
        label="Username"
        name="username"
        rules={[
          {
            required: true,
            message: "Please input your username!",
          },
        ]}
      >
        <input />
      </Form>

      <Form
        label="Password"
        name="password"
        rules={[
          {
            required: true,
            message: "Please input your password!",
          },
        ]}
      >
        <input />
      </Form>

      <Form>
        <checkbox>Remember me</checkbox>
      </Form>

      <Form>
        <button type="primary" htmlType="submit">
          Submit
        </button>
      </Form>
    </form>
  );
};
export default Form;
